import React, { useState } from "react";
import BdayAge from "./BdayAge";

const App = () => {
  let [number, setNumber] = useState(20);
  let generateAge = () => number + 1;

  const handleAge = () => {
    setNumber(generateAge());
  };

  return (
    <div className="App">
      <BdayAge getAge={handleAge} Age={number} />
    </div>
  );
};
export default App;
